const App = () => {
  return (
    <Router>
      {/* <Header /> */}
      <main className='py-3'>
        <Container>
          <h1>Formulário</h1>
          <Route path='/formulario' component={FormularioScreen} />
        </Container>
      </main>
      {/* <Footer /> */}
    </Router>
  )
}

export default App
